import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import { Routes } from './routes';

// Pages
import Alunos from './pages/Alunos';
import Individual from './pages/Individual';
import Turmas from './pages/Turmas';
import Treinos from './pages/Treinos';
import Agendamentos from './pages/Agendamentos';
import Login from './pages/Login';
import Cadastrar from './pages/Cadastrar';
import Perfil from './pages/Perfil';

// Components
import Sidebar from './components/Sidebar';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Preloader from './components/Preloader';

import ProtectedRoutes from './protectedroutes';

const App = () => {
  const isAuthenticated = !!localStorage.getItem('')
  return (
    <Router>
      <Sidebar />
      <main className="content">
        <Navbar />
        <Preloader />
        <Switch>
          <Route exact path={Routes.Login.path} component={Login} />
          <Route exact path={Routes.Cadastrar.path} component={Cadastrar} />
          <ProtectedRoutes exact path={Routes.Perfil.path} component={Perfil} />
          <ProtectedRoutes exact path={Routes.Alunos.path} component={Alunos} />
          <ProtectedRoutes exact path={Routes.Individual.path} component={Individual} />
          <ProtectedRoutes exact path={Routes.Turmas.path} component={Turmas} />
          <ProtectedRoutes exact path={Routes.Treinos.path} component={Treinos} />
          <ProtectedRoutes exact path={Routes.Agendamentos.path} component={Agendamentos} />
          <Redirect to={Routes.NotFound.path} />
        </Switch>
        <Footer />
      </main>
    </Router>
  );
};

export default App;


